import React from 'react';
import './App.css';
import HeaderRouteManager from '../components/header/HeaderRouteManager';
import FooterRouteManager from '../components/footer/FooterRouteManager';
import Routes from '../components/pages/Routes';

function App() {


  return (
    <div className="App">
        <HeaderRouteManager/>
         <Routes/>
        <FooterRouteManager/>
    </div>
  );
}

export default App;
